class Register extends Component {
  state = {  }
  render() { 
    return (
      <React.Fragment>
      <div style={style.container}></div>
        <div style={style.popup}>
          <div>Username</div>
          <div>Emil</div>
          <div>Password</div>
        </div>
      </React.Fragment>
    );
  }
}
export default Register;


